import Link from "next/link";

const Navbar = () => (
  <nav className="navbar">
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/portfolio">
          <a>Portfolio</a>
        </Link>
      </li>
      <li>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </li>
      <li>
        <Link href="blog">
          <a>Blog</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      .navbar {
        float: right;
      }

      .navbar ul {
        list-style: none;
        padding: 0px;
      }

      .navbar li {
        padding: 30px;
        display: inline;
      }

      .navbar a {
        letter-spacing:3px;
        color: #17b040;
        text-decoration: none;
        text-transform: uppercase;
        font-weight: bold;
        font-size: 26px;
        padding-right: 15px;
      }

      .navbar a:hover {
        color: red;
      }
    `}</style>
  </nav>
);

export default Navbar;
